import styles from './HeaderCartButton.module.css'
export const HeaderCartButton = (props) => {
    return (
        <button className={styles.button}>
            <span className={styles.icon}>
                <CartIcon/>
            </span>
            <span>Your Cart</span>
            <span className={styles.badge}>3</span>
        </button>
    );
};
